import React ,{ useState , useEffect }from 'react'
import './Projects.css'

function Projects() {
    const [projects, setProjects] = useState([]);

    const fetchData = () => {
    return fetch('http://localhost:8000/api/data')
          .then((response) => response.json())
          .then((data) => setProjects(data));
    }
    useEffect(() => {
    fetchData();
    },[])
  return (
    <div className='body'>
        <div className="flex-container">
        {projects && projects.length > 0 && 
        projects.map((Obj, index) => (
            <div className="flex-item">
                <div className="card">
                <p>Obj.Project_Title</p>
                <p>Obj.Project_Technologies</p>
                <p>Obj.Technical_Skillset_Frontend</p>
                <p>Obj.Technical_Skillset_Backend</p>
                <p>Obj.Technical_Skillset_Databases</p>
                <p>Obj.Technical_Skillset_Infrastructre</p>
                <p>Obj.Other_Information_Availability</p>
                </div>
            </div>
          ))}
        </div>
    </div>
  )
}

export default Projects


